var agregarBtns = document.querySelectorAll('.producto');

agregarBtns.forEach(function (agregarBtn) {
    agregarBtn.addEventListener('click', function () {
        var precio = parseFloat(agregarBtn.getAttribute('precio')); // Convertir a número
        var titulo = agregarBtn.getAttribute('titulo');
        var modal = document.getElementById('modal');
        var fila_tr = document.getElementById('fila');

        //creo nueva fila
        var nueva_fila = document.createElement('tr');

        //creo la fila td del nombre del producto
        var fila_titulo = document.createElement('td');
        fila_titulo.textContent = titulo;


        //creo la fila de la cantidad 
        var fila_cantidad = document.createElement('td');
        fila_cantidad.setAttribute('id', 'cantidad');
        //creo el input tipo numero que ira dentro de la fila de la cantidad
        var input_number = document.createElement('input');
        input_number.setAttribute('type', 'number');
        input_number.className = 'valor';
        input_number.setAttribute('min', '1');
        input_number.setAttribute('max', '100');
        input_number.setAttribute('value', 1);
        input_number.setAttribute('class', 'valor_number');



        input_number.addEventListener('change', function () {
            var cantidad = parseFloat(input_number.value); // Obtener valor del input
            var subtotal = precio * cantidad;
            fila_precio.textContent = subtotal.toFixed(2); // Actualizar el subtotal en la tabla

        });

        fila_cantidad.appendChild(input_number);


        var fila_precio = document.createElement('td');
        fila_precio.textContent = precio.toFixed(2); // Mostrar el precio original

        nueva_fila.appendChild(fila_titulo);
        nueva_fila.appendChild(fila_cantidad);
        nueva_fila.appendChild(fila_precio);


        document.getElementById('tabla').appendChild(nueva_fila);
        /*document.getElementById('tabla').appendChild(fila_titulo);
        document.getElementById('tabla').appendChild(fila_cantidad);
        document.getElementById('tabla').appendChild(fila_precio);*/

        modal.style.display = 'block';



        //accedo a los precios y accedo al hijo final de la tabla
        var precios = document.querySelectorAll('#tabla td:last-child');
        var total = 0;

        precios.forEach(function (precio) {
            total += parseFloat(precio.textContent);
        });

        console.log('Total: ', total);

        // 

    });
});

