/*var totalText = document.getElementById('total-text');
totalText.textContent = 'Total: $' + calcularTotal();*/

function calcularTotal() {
    var precios = document.querySelectorAll('#tabla td:last-child');
    var total = 0;

    precios.forEach(function (precio) {
        total += parseFloat(precio.textContent);
    });

    return total.toFixed(2);
}


// Agregar evento click al botón "Imprimir ticket"
function descargarPDF() {
    var doc = new jsPDF();
   
    var tabla = document.querySelector('#tabla');
    var tablaHTML = tabla.outerHTML;

    var filas = tabla.getElementsByTagName('tr');
    for (var i = 0; i < filas.length; i++) {
        var celdas = filas[i].getElementsByTagName('td');
        var encabezados = filas[i].getElementsByTagName('th');
        var valores = [];

        for (var j = 0; j < celdas.length; j++) {
            if (j === 1) {
                /* Si es la celda "Cantidad", obtener el valor del input en lugar del texto */
                var input = celdas[j].querySelector('input');
                valores.push(input.value);
            } else {
                valores.push(celdas[j].textContent);
            }
        }

        for (var k = 0; k < encabezados.length; k++) {
            valores.push(encabezados[k].textContent);
        }

        var filaTexto = valores.join(' --- ');
        //tamaño de los encabezados
        doc.setFontSize(20);

        var imgData ='data:image/jpeg;base64,';
        
        doc.addImage(imgData, 10, 10, 50, 32);
        
        //linea del titulo del PDF
        doc.text("Ticket de compra", 10, 50);
        // codigo que modifica el tamaño de fuente de la tabla html
        doc.setFontSize(12);
        // codigo que saca en formato los datos de la tabla para el pdf
        doc.text(10, 70 + (i * 10), filaTexto);
    }

    // Agregar línea separadora
    doc.line(10, 70 + (filas.length * 10), 200, 70 + (filas.length * 10));

    // Agregar fila con el total
    var totalTexto = 'Total: $' + calcularTotal();
    doc.setFontSize(12);
    doc.text(totalTexto, 10, 80 + (filas.length * 10));

    doc.save('Ticket La Fregona.pdf');
}


imprimirBtn.addEventListener('click', descargarPDF);
